In C, you can terminate a program using the `exit()` function. 

Here's a basic example:

```c
#include <stdio.h>
#include <stdlib.h>

int main() {
  printf("This program will terminate now.\n");
  exit(0); 
  return 0; 
}
```

The `exit()` function takes an integer argument as its parameter, which is typically 0 to indicate successful termination.  

Remember that `exit()` immediately stops the program's execution, so any code after it won't be run. 


Let me know if you'd like to explore more about error handling or different scenarios for program termination.
